//         { "_id": "613c854ef601f09e344f43bf", "title": "A Él la gloria", "lyric": "DO                          FA\nQue todos se postren ante Dios nuestro Señor,\nSOL                      DO  SOL\nque todas las almas lo adoren\nEn la Eucaristía, fuente viva de amor,\nPan de vida nueva que desciende por vos.\n\nLAm                        MIm\nRey de reyes, creador del hombre,\n     FA       REm        SOL    \ntodopoderoso en tu majestad.\nMI7                             LAm\nSanto Cristo que entregaste al mundo\n                 FA                     SOL\ntodo tu amor profundo para darnos tu vida.\n\n  DO  FA    SOL DO   \nGloria,   gloria.\nSOL        DO  FA    SOL  DO\n A El la Gloria,   gloria.\n\nLuz que alumbra siempre donde hay oscuridad,\nBuen pastor que a todos nos socorre.\nCordero inmolado que se ofrece en el altar\nPara darle vida nueva al hombre.\n\nRey de reyes, creador del hombre,\nTodo poderoso en su majestad.\nSanto Cristo que entregaste al mundo\nTodo tu amor profundo para darnos tu vida\n\nGloria, gloria.\nA El la Gloria, gloria", "__v": 0, "author": "Efatá", "labels": ["jesus"], "topics": [], "creator": "Daniel Vinet", "rating": [] }, { "_id": "613c8597f601f09e344f43c2", "title": "A casa de Zacarí­as", "lyric": "RE              \nA casa de Zacarí­as,\n   LA7           RE\nMarí­a se encaminó,\n   LA7           RE\n/camino de montañas\n              SOL             RE\ny en sus entrañas el mismo Dios./ (bis)\n \nRE\nLlena de gracia has venido a mí­,\n                  LA\nla mamacita del Salvador.\n/Dichosa sea la que creyó\nen la promesa de su Señor./ (bis)\n \nOyó Isabel el saludo,\nsu seno se estremeció\n/y el Espíritu Santo\ncasi cantando en ella obró./ (bis)\n\nEn el Señor yo me alegro,\nMaría un canto entonó,\n/puso en mí la mirada\nsu humilde esclava de corazón./ (bis)\n\nFortaleció a los humildes,\nal poderoso lo echó,\n/por la misericordia\nque en nuestra historia El derramó./ (bis)", "__v": 0, "creator": "Daniel Vinet", "labels": [], "rating": [] }, { "_id": "613cfd7a5df810100d1099b3", "title": "A la Virgen de Luján", "lyric": "      DO          SOL7\nOh María, Madre Nuestra,\n         DO   LAm   SOL\nVirgen Santa de Luján,\n      DO        SOL7\n/Amparanos y guianos\n       DO    SOL   DO\na la patria celestial./ (bis)\n\nEn un día de milagro\njunto al río de Luján\n/te quedaste con nosotros\ntierna Madre de bondad./ (bis)\n\nHoy los hijos que te aman\nvienen juntos a rezar\n/por la patria y por el mundo\nimplorándote la paz./ (bis)\n\nLa salud que es don del cielo\nte venimos a implorar,\n/oh, Salud de los enfermos\nlíbranos de todo mal./ (bis)\n\nTen piedad de nuestras almas,\nno queremos más pecar,\n/en ti está nuestra esperanza,\nno nos puedes defraudar./ (bis)\n\nUna gracia te pedimos\nVirgen Santa de Luján,\n/de vivir siempre a tu lado\ny de amarte más y más./ (bis)", "__v": 0, "creator": "Daniel Vinet", "labels": [], "rating": [] }, { "_id": "613cff2d5df810100d1099b7", "title": "A tanto amor", "lyric": "SOL                          MIm\nHecha un mar de lágrimas al verlo allí en la cruz\nDO                           RE\nse acordó del niño que ella misma diera a luz.\nMIm                           DO\nY entre el firmamento y su mirada de dolor\n           SOL                 RE\nbien supo serle fiel a tanto amor.\n\nNo rompió el silencio cuando el cielo se quebró,\nno volteó sus ojos al final cuando expiró.\nSe sintió caer, pero a si mismo, no cayó\ny amó a pesar de que el mundo lo entregó.\n\n         MIm       DO           SOL      RE\n/Solo besó sus pies y a Dios se lo ofreció,\nsin preguntar por qué a todos perdonó,\npues entendió el amor\nque Jesús predicó, que su Hijo predicó.\nElla entendió el amor, que le enseño./\n\nEntre la llovizna la tristeza y el temor,\nlo tomó en sus brazos cuando ya no respiró.\nJunto con su alma le traspasó el corazón,\nla espada que esa cruz todo lo consumó.\n\nNo rompió el silencio cuando el silencio calló,\nno volteó sus ojos y el sepulcro se cerró.\nSe sintió morir pero su fe permaneció\ny amó a pesar de que todo se oscureció.\t", "__v": 0, "creator": "Daniel Vinet", "labels": [], "rating": [] }, { "_id": "613cff855df810100d1099b9", "title": "A veces (Siempre nuestro amigo)", "lyric": "  RE        FA#m         SIm        \nA veces en algunos días grises,\n                     SOL\ncuando pierdo la esperanza,\n                       LA\ncuando no encuentro la paz,\n      SOL      LA             SIm \nme pregunto si es verdad que existes,\n                      SOL\nsi realmente eres mi amigo,\n     MIm            LA\nsi lo eres, dónde estás.\n\nEs ese el momento cuando dudo,\nun momento de vacío \ny de fría oscuridad,\nporque pienso que si en verdad no existes,\nmi vida sería vana \ncomo un libro sin final.\n\n         RE            LA           Sim\n//Pero una voz siento surgir dentro de mí,\n                        SOL\nque me devuelve toda mi fe,\nMIm                   LA\nes la voz de Dios mi amigo.\nY es esa voz que con dulzura me habla de paz,\nla que me dice que Dios será\nsiempre nuestro amigo.//\n\nA veces, me contás que estás perdido, \nque no encuentras el camino \nque te devuelva la fe.\nY me dices que Dios está muy lejos,\nque no sabes acercarte, \nquieres que se acerque Él.\n\nAhora que ya encontré de nuevo,\nal Maestro que me guía \ny que me enseña amar,\nte invito a que intentes encontrarlo, \nverás que no está tan lejos \ny que Él te espera ya.\n\n//Y tú también has de escuchar la dulce voz\nque te hablará llena de amor, \nes la voz de Dios mi amigo.\nY es esa voz \nque con dulzura te habla de paz,\nla que me dice que Dios será \nsiempre nuestro amigo.//", "__v": 0, "creator": "Daniel Vinet", "labels": [], "rating": [] }, { "_id": "613cfff85df810100d1099bb", "title": "Abre los ojos de mi alma", "lyric": "RE                    \nAbre los ojos de mi alma\nREmaj7\nAbre mis ojos, ¡oh Dios!\n           SOL\nYo quiero verte,\n           RE\nyo quiero verte. (bis)\n\n      LA            SIm\nVerte alto en majestad\n  SOL                     LA\nBrillas en la luz de tu gloria.\n                             SIm\nNos brindas tu gracia, ¡oh Dios!\n         SOL                        LA\nY canto santo, santo, santo,\n  SOL          LA               RE\nsanto, santo, santo, yo quiero verte.\t", "__v": 0, "creator": "Daniel Vinet", "labels": [], "rating": [] }, { "_id": "6144d10f2d6d4f8085af95cb", "title": "Abre tus brazos", "lyric": "          RE                FA#m\nSi algún día, el odio y la guerra                                       \n                     SOL\nya no surcan más la tierra:\n         MIm       LA \nserá el Reino del Amor. \nTodos unidos, con las manos estrechadas \nalzaremos la mirada \npara encontrar al Señor.  \n\nRE        FA#m     SOL    LA\nAbre tus Brazos, Señor, Señor. \nVen a mi lado, mi Dios, mi Dios.  \n\nSi los cañones, las granadas y las balas \nse cambiaran por palabras \ny por rezos hacia Dios. \nSi la mentira, el miedo y la codicia \nnuestro suelo ya no pisan, \npodremos vivir mejor.  \n\nCuando los hombres dejen de empuñar sus armas \ntomen los picos y palas, \ncambien los cardos por flor. \nCuando unamos nuestras manos temblorosas \npara entregar una rosa \no para pedir perdón.  \n\nCuando los hombres suban los ojos al cielo \ny encuentren allí consuelo, \nhallen allí su calor. \nYa que es difícil, el mundo en que vivimos \npor nuestra fe te pedimos: \n\"abre tus brazos, Señor\".", "topics": [], "labels": [], "rating": [], "__v": 0, "creator": "Daniel Vinet" }, { "_id": "6144d1782d6d4f8085af95cd", "title": "Abre tus brazos", "lyric": "RE         SOL          RE\nAbre tus brazos buen Señor\nRE         SOL          RE\nAbre tus brazos buen Señor\nLA           SOL               RE\nNo me dejes nunca solo en la vida\nLA           SOL               RE         LA\nGuíame por buenas sendas, protégeme del mal\n         SOL                           RE\nPor los siglos de los siglos, en tu amor. \n\nRE         SOL          RE\nAbre tus brazos buen 